import React from "react";
// Importe aqui os componentes de páginas que você precisar
import DoadorList from "./pages/DoadorList";
import DoadorForm from "./pages/DoadorForm";

function App() {
  return (
    <div>
      <h1>Banco de Sangue (Front-end)</h1>
      <hr />
      <DoadorList />
      <hr />
      <DoadorForm />
    </div>
  );
}

export default App;
